import React from 'react'
import Button from './Button'
const Section = (sec) => {
    function portion()
    {
        switch(sec){
            case 1:
            {
              return(
                    <div className='headerButton'>
                    <Button ID={'Get Quote'}/>
                    <Button ID={'LogIn'}/>
                    </div>
                )
            
            }
            default:
            {
                return 0;
            }
        }
    }
  return (
    portion()
  )
}

export default Section
